import React from 'react'
import { StyleSheet, Text, View, Button } from 'react-native'
import { createStackNavigator } from '@react-navigation/stack';


export default function controlPanel({navigation}) {
    return (
        <View
        style={{alignItems: 'center',flex:2,flexDirection:"column",justifyContent:'space-between',padding:'2'}}>
           <Button 
          
           title="Catalog"
           onPress={() => navigation.navigate("Catalog Screen")}> 
           
            
            </Button>
           
          
            
            <Button
            title="Order Register"
            onPress={() => navigation.navigate("Order Register")}
            >
                
            </Button>
        </View>
    )
}

